import { useState, useEffect } from 'react';
import { weatherService } from '../../services/api';
import {
  Container,
  Typography,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Alert,
  CircularProgress,
  Box
} from '@mui/material';

export default function WeatherHistory() {
  const [searches, setSearches] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        console.log('Fetching search history...');
        const response = await weatherService.getSearchHistory();
        console.log('History response:', response.data);
        setSearches(response.data);
      } catch (err) {
        console.error('History error:', err);
        setError(
          err.response?.data?.message || 
          'Failed to fetch search history'
        );
      } finally {
        setLoading(false);
      }
    };

    fetchHistory();
  }, []);

  if (loading) {
    return (
      <Container maxWidth="md" sx={{ mt: 4, textAlign: 'center' }}>
        <CircularProgress />
      </Container>
    );
  }

  if (error) {
    return (
      <Container maxWidth="md" sx={{ mt: 4 }}>
        <Alert severity="error" sx={{ mb: 2 }}>
          {error}
          {process.env.NODE_ENV === 'development' && (
            <pre style={{ whiteSpace: 'pre-wrap' }}>
              {JSON.stringify(error, null, 2)}
            </pre>
          )}
        </Alert>
      </Container>
    );
  }

  if (searches.length === 0) {
    return (
      <Container maxWidth="md" sx={{ mt: 4 }}>
        <Typography variant="h6" textAlign="center">
          No search history found
        </Typography>
      </Container>
    );
  }

  return (
    <Container maxWidth="md" sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>
        Search History
      </Typography>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>City</TableCell>
              <TableCell>Temperature</TableCell>
              <TableCell>Description</TableCell>
              <TableCell>Humidity</TableCell>
              <TableCell>Wind Speed</TableCell>
              <TableCell>Searched At</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {searches.map((search) => (
              <TableRow key={search.id}>
                <TableCell>{search.city}</TableCell>
                <TableCell>{search.temperature}Â°C</TableCell>
                <TableCell>{search.description}</TableCell>
                <TableCell>{search.humidity}%</TableCell>
                <TableCell>{search.windSpeed} m/s</TableCell>
                <TableCell>
                  {new Date(search.searchedAt).toLocaleString()}
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Container>
  );
}
